import styled from 'styled-components'
import { Link } from 'react-router-dom'
import { IoMdArrowBack } from 'react-icons/io'

const StyledHeader = styled.header`
    display: flex;
    align-items: center;
    border-style: solid;
    margin-top: 1em;
`;

const Menubutton = styled.i`
    font-size: 3em;
    margin: 0;
    padding: 0;
`;

const Title = styled.h2`
    margin-left: 0;
`;

const Header = () => {
    return (
        <StyledHeader>
            <Menubutton><Link to='/menu'><IoMdArrowBack /></Link></Menubutton>
            <Title>WMS Management</Title>
            <h3 style={{marginLeft: 'auto', marginRight: '1em'}}>USER</h3>
        </StyledHeader>
    )
}

export default Header
